import { Storage } from "../infrastructure/Storage";
import {
  InvlalidSessionTokenError as InvalidSessionTokenError,
  UsersRepository,
  UnauthorizedError,
} from "../infrastructure/repositories";
import { UserItem } from "../models/presentation/UserItem";

export class FetchUsersInput {}

export class FetchUsersOutput {
  readonly users: UserItem[];

  constructor(params: { users: UserItem[] }) {
    this.users = params.users;
  }
}
export class FetchUsersUsecase {
  static async fetch(
    usersRepository: UsersRepository,
    sessionToken: string
  ): Promise<UserItem[]> {
    try {
      const usersCell = await usersRepository.fetch(sessionToken);
      const formattedUsers = usersCell.map((user: any) => new UserItem(user));
      return formattedUsers;
    } catch (err) {
      console.error(err);
      throw err;
    }
  }
}
